import React, { Component } from 'react';
import Todos from './Todos'
import AddTodo from './AddTodo'

class App extends Component {
  state = {
    todos: [],
    todoToShow: "all"
  };

  deleteTodo = (id) => {
    const todos = this.state.todos.filter(todo => {
      return todo.id !== id
    });
    this.setState({
      todos
    })
  }



  addTodo = (todo) => {
    todo.id = Date.now();
    let todos = [...this.state.todos, todo];
    this.setState({
      todos
    })
  }

  toggleComplete = id => {
    this.setState(state => ({
      todos: state.todos.map(todo => {
        if (todo.id === id) {
          return {
            ...todo,
            complete: !todo.complete
          };
        } else {
          return todo;
        }
      })
    }));
  };

  updateTodoToShow = string => {
    this.setState({
      todoToShow: string
    });
  };

  render() {
    let todos = [];

    if (this.state.todoToShow === "all") {
      todos = this.state.todos;
    } else if (this.state.todoToShow === "active") {
      todos = this.state.todos.filter(todo => !todo.complete);
    } else if (this.state.todoToShow === "complete") {
      todos = this.state.todos.filter(todo => todo.complete);
    }
    const svgFoot = <path  d="M 13.01798,25.39451 C 12.77399,25.64089 7.253,23.65425 7.18568,23.16408 6.35644,17.1269 10.30763,12.32575 14.15474,12.10585 c 4.51136,-0.25788 3.02218,9.08888 -1.13676,13.28866 z m -6.24402,9.15377 c -1.75334,-0.64849 -2.22119,-3.43642 -1.02572,-7.0593 0.23575,-0.71443 6.23884,1.28298 6.15248,1.91291 -0.6586,4.80359 -3.37343,5.79488 -5.12676,5.14639 z" />;

    return (
      <div className="todo-app container">
        <h1 className="center pink-text">TODOS</h1>
        <p className="center pink-text">planning is key to success</p>

        <AddTodo addTodo={this.addTodo} />
        <Todos
          className="todo-list"
          todos={todos}
          deleteTodo={this.deleteTodo}
          toggleComplete={this.toggleComplete} />
        <div className="left-todo center">TODOS LEFT: {this.state.todos.filter(todo => !todo.complete).length}</div>
        <div className="botton-option-todo center">
          <button className="botton-all" onClick={() => this.updateTodoToShow("all")}>All </button>
          <button className="botton-active" onClick={() => this.updateTodoToShow("active")}> Active </button>
          <button className="botton-completed" onClick={() => this.updateTodoToShow("complete")}> Complete </button>
        </div>
        <svg  width="20%" height="20%" viewBox="0 0 64 64" className="footsteps-right" id="footstep-0">{svgFoot}</svg>
        <svg  width="20%" height="20%" viewBox="0 0 64 64" className="footsteps-left" id="footstep-1">{svgFoot}</svg>   
        <svg  width="20%" height="20%" viewBox="0 0 64 64" className="footsteps-right" id="footstep-2">{svgFoot}</svg>
        <svg  width="20%" height="20%" viewBox="0 0 64 64" className="footsteps-left" id="footstep-3">{svgFoot}</svg>   
        <svg  width="20%" height="20%" viewBox="0 0 64 64" className="footsteps-right" id="footstep-4">{svgFoot}</svg>
        <svg  width="20%" height="20%" viewBox="0 0 64 64" className="footsteps-left" id="footstep-5">{svgFoot}</svg>
        <svg  width="20%" height="20%" viewBox="0 0 64 64" className="footsteps-right" id="footstep-6">{svgFoot}</svg>
        <svg  width="20%" height="20%" viewBox="0 0 64 64" className="footsteps-left" id="footstep-7">{svgFoot}</svg>
        <svg  width="20%" height="20%" viewBox="0 0 64 64" className="footsteps-right" id="footstep-8">{svgFoot}</svg>
        <svg  width="20%" height="20%" viewBox="0 0 64 64" className="footsteps-right" id="footstep-9">{svgFoot}</svg>
      </div>
    );
  }
}

export default App;
